Information
------------------------------

Swordfish W5856 Restoration Project
For over two years British Aerospace, Brough has been restoring a World War II Fairey Swordfish Torpedo/Bomber aircraft. '5856' was originally built by the company's predecessor, Blackburn Aircraft at Sherburn-in-Elmet in 1941. It was acquired by British Aerospace in 1990 from the Strathallan Collection in Scotland with the purpose of restoration, and eventual presentation in a flying condition to the Royal Navy Historic Flight. The small team of engineers restoring the Swordfish at Brough has certainly been challenged over the twenty six month restoration. With a distinct lack of design information concerning the aircraft, the knowledge, experience and above all, the enthusiasm of key individuals, have been paramount in ensuring the aircraft's successful completion today. With the use of modern technology, confidence in the structural integrity of the aircraft was achieved. The aircraft, to be known as the 'British Aerospace Swordfish', is to be based with the Royal Navy Historic Flight at RNAS Yeovilton. It is hoped that '5856', in its distinctive pre-war 810 Squadron colours, will bring enjoyment for many people over the years to come, as it is seen in numerous airshows around the country. Although a core team of individuals has supported the project from the start, there have been a large number of people throughout the Brough factory who have supported this project.

